    public String findLongestWord(String s, List<String> dictionary) {
        if (s == null || s.length() <= 0 || dictionary == null || dictionary.isEmpty()) {
            return "";
        }

        Collections.sort(dictionary, new Comparator<String>() {
            @Override
            public int compare(String o1, String o2) {
                if (o1.length() == o2.length()) {
                    return -o1.compareTo(o2);
                }
                return o1.length() - o2.length();
            }
        });

        for (int index = dictionary.size() - 1; index >= 0; index--) {
            if (isSubstr(s, dictionary.get(index))) {
                return dictionary.get(index);
            }
        }

        return "";
    }

    private boolean findWord(String source, String target) {
        if (target == null || target.isEmpty() || target.length() > source.length()) {
            return false;
        }
        int sourceIndex = 0;
        int targetIndex = 0;
        while (sourceIndex < source.length() && targetIndex < target.length()) {
            if (source.charAt(sourceIndex) == target.charAt(targetIndex)) {
                targetIndex++;
            }
            sourceIndex++;
        }
        return (targetIndex == target.length());
    }

    private boolean isSubstr(String s, String target) {
        int i = 0, j = 0;
        while (i < s.length() && j < target.length()) {
            if (s.charAt(i) == target.charAt(j)) {
                j++;
            }
            i++;
        }
        return j == target.length();
    }
